import React, { Component } from "react";
import { Link } from "react-router-dom";

export class Navbar extends Component {
  render() {
    return (
      <nav>
        <ul className="nav">
          <li>
            <Link to="/" className="Home">
              BookNotes
            </Link>
          </li>
          <li>
            <Link to="/" className="Sign-In">
              {" "}
              Sign In
            </Link>
          </li>
        </ul>
      </nav>
    );
  }
}
